import React from "react";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import Login from "./pages/Login";
import Register from "./pages/Register";





const App = () => {
  return (
    <div>

      <BrowserRouter>
      <Routes>
        <Route to='' element={<Login/>}></Route>
      </Routes>
      </BrowserRouter>

      

      <Register/>
      
    </div>
  );
};

export default App;
